import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  const [currentFeature, setCurrentFeature] = useState(0);
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const [stats, setStats] = useState({ clients: 0, vehicles: 0, cities: 0, trips: 0 });
  const [isVisible, setIsVisible] = useState(false);

  const features = [
    { icon: 'âš¡', text: 'Instant Booking', desc: 'Book in 60 seconds' },
    { icon: 'ðŸŽ¯', text: 'Premium Fleet', desc: 'Luxury vehicles only' },
    { icon: 'ðŸ›¡ï¸', text: 'Full Insurance', desc: 'Complete coverage' },
    { icon: 'ðŸŒŸ', text: '5-Star Service', desc: 'Exclusive experience' }
  ];

  const clients = [
    { name: "Google", logo: "ðŸ”", type: "Tech Giant" },
    { name: "Microsoft", logo: "ðŸ’»", type: "Enterprise" },
    { name: "Toyota", logo: "ðŸš—", type: "Automotive" },
    { name: "Samsung", logo: "ðŸ“±", type: "Electronics" },
    { name: "Unilever", logo: "ðŸ­", type: "Manufacturing" },
    { name: "Deloitte", logo: "ðŸ“Š", type: "Consulting" }
  ];

  const services = [
    {
      icon: "ðŸ’¼",
      title: "Corporate Rental",
      description: "Exclusive fleet solutions for enterprise clients with dedicated support.",
      stats: "500+ Companies"
    },
    {
      icon: "âœˆï¸",
      title: "Airport Services",
      description: "Premium airport transfers with executive meet & greet services.",
      stats: "50+ Airports"
    },
    {
      icon: "ðŸ¨",
      title: "Hotel Partnership",
      description: "Luxury transportation for 5-star hotel guests and VIP clients.",
      stats: "200+ Hotels"
    }
  ];

  // Animations
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentFeature((prev) => (prev + 1) % features.length);
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({
        x: (e.clientX / window.innerWidth - 0.5) * 30,
        y: (e.clientY / window.innerHeight - 0.5) * 30
      });
    };
    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setIsVisible(true);
          // Animate stats counting
          const duration = 2000;
          const steps = 60;
          const stepDuration = duration / steps;

          const animateStat = (start, end, setter) => {
            let current = start;
            const increment = (end - start) / steps;
            const timer = setInterval(() => {
              current += increment;
              if (current >= end) {
                current = end;
                clearInterval(timer);
              }
              setter(Math.floor(current));
            }, stepDuration);
          };

          animateStat(0, 10000, (val) => setStats(prev => ({...prev, clients: val})));
          animateStat(0, 500, (val) => setStats(prev => ({...prev, vehicles: val})));
          animateStat(0, 50, (val) => setStats(prev => ({...prev, cities: val})));
          animateStat(0, 25000, (val) => setStats(prev => ({...prev, trips: val})));
        }
      },
      { threshold: 0.3 }
    );

    observer.observe(document.getElementById('stats-section'));
    return () => observer.disconnect();
  }, []);

  return (
    <div className="relative overflow-hidden">
      {/* Hero Section */}
      <section className="min-h-screen relative overflow-hidden grid-pattern">
        {/* Advanced Background Elements */}
        <div 
          className="absolute top-20 -left-20 w-80 h-80 bg-blue-500/10 rounded-full blur-3xl animate-float"
          style={{ transform: `translate(${mousePosition.x * 0.5}px, ${mousePosition.y * 0.5}px)` }}
        ></div>
        <div 
          className="absolute bottom-40 -right-20 w-96 h-96 bg-purple-500/10 rounded-full blur-3xl animate-float"
          style={{ 
            animationDelay: '2s',
            transform: `translate(${mousePosition.x * 0.3}px, ${mousePosition.y * 0.3}px)` 
          }}
        ></div>
        <div 
          className="absolute top-1/2 left-1/3 w-64 h-64 bg-cyan-500/5 rounded-full blur-3xl animate-float"
          style={{ 
            animationDelay: '4s',
            transform: `translate(${mousePosition.x * 0.4}px, ${mousePosition.y * 0.4}px)` 
          }}
        ></div>

        <div className="container-custom section-padding relative z-10">
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-16 items-center">
            {/* Content */}
            <div className="text-center lg:text-left">
              {/* Premium Badge */}
              <div className="inline-flex items-center glass rounded-full px-6 py-3 mb-8 animate-pulse-glow border border-cyan-500/30">
                <div className="w-2 h-2 bg-cyan-400 rounded-full mr-2 animate-ping"></div>
                <span className="text-sm font-semibold text-cyan-400">ENTERPRISE-GRADE SOLUTIONS</span>
              </div>

              <h1 className="text-5xl md:text-6xl lg:text-7xl font-black leading-tight mb-6">
                <span className="text-white">Elite Mobility</span>
                <br />
                <span className="text-gradient">For Visionary</span>
                <br />
                <span className="text-white">Businesses</span>
              </h1>

              <p className="text-xl text-gray-300 mb-8 max-w-lg mx-auto lg:mx-0 leading-relaxed">
                Powering the transportation needs of Fortune 500 companies with our 
                <span className="text-gradient font-semibold"> premium fleet</span> and 
                <span className="text-gradient font-semibold"> enterprise-grade solutions</span>.
              </p>

              {/* Auto-rotating Feature */}
              <div className="glass rounded-2xl p-6 mb-8 max-w-md mx-auto lg:mx-0 border border-white/10">
                <div className="flex items-center justify-center lg:justify-start space-x-4">
                  <span className="text-3xl animate-bounce">{features[currentFeature].icon}</span>
                  <div>
                    <div className="text-lg font-semibold text-white">{features[currentFeature].text}</div>
                    <div className="text-sm text-cyan-400">{features[currentFeature].desc}</div>
                  </div>
                </div>
              </div>

              {/* CTA Buttons */}
              <div className="flex flex-col sm:flex-row gap-4 justify-center lg:justify-start">
                <Link to="/kendaraan" className="btn-primary group relative overflow-hidden text-center">
                  <span className="relative z-10">Explore Enterprise Fleet</span>
                  <div className="absolute inset-0 bg-gradient-to-r from-purple-600 to-blue-500 transform scale-x-0 group-hover:scale-x-100 transition-transform duration-500 origin-left"></div>
                </Link>
                <button className="btn-secondary group">
                  <span className="relative z-10">Schedule Demo</span>
                </button>
              </div>

              {/* Trust Badges */}
              <div className="flex flex-wrap items-center justify-center lg:justify-start gap-6 mt-12">
                <div className="flex items-center space-x-2 text-sm text-gray-400">
                  <div className="w-2 h-2 bg-green-400 rounded-full animate-pulse"></div>
                  <span>ISO 9001 Certified</span>
                </div>
                <div className="flex items-center space-x-2 text-sm text-gray-400">
                  <div className="w-2 h-2 bg-blue-400 rounded-full animate-pulse"></div>
                  <span>24/7 Support</span>
                </div>
                <div className="flex items-center space-x-2 text-sm text-gray-400">
                  <div className="w-2 h-2 bg-purple-400 rounded-full animate-pulse"></div>
                  <span>Global Coverage</span>
                </div>
              </div>
            </div>

            {/* Hero Visual */}
            <div className="relative">
              {/* Main Card */}
              <div 
                className="glass rounded-3xl p-8 transform rotate-2 hover:rotate-0 transition-transform duration-500 border border-white/10"
                style={{ transform: `rotate(2deg) translate(${mousePosition.x * 0.1}px, ${mousePosition.y * 0.1}px)` }}
              >
                <div className="glass-dark rounded-2xl p-6 transform -rotate-2 border border-white/5">
                  <div className="bg-gradient-to-br from-slate-800 to-slate-900 rounded-2xl h-96 flex items-center justify-center relative overflow-hidden">
                    {/* Animated Car Visualization */}
                    <div className="absolute inset-0 flex items-center justify-center">
                      <div className="w-72 h-36 bg-gradient-to-r from-blue-500/10 to-purple-500/10 rounded-2xl relative border border-blue-500/20">
                        <div className="absolute -top-6 left-12 w-56 h-8 bg-gradient-to-r from-blue-500/20 to-purple-500/20 rounded-full border border-blue-500/30"></div>
                        <div className="absolute -bottom-4 left-8 w-10 h-10 bg-blue-500/20 rounded-full border border-blue-500/30 animate-spin-slow"></div>
                        <div className="absolute -bottom-4 right-8 w-10 h-10 bg-purple-500/20 rounded-full border border-purple-500/30 animate-spin-slow" style={{animationDirection: 'reverse'}}></div>
                      </div>
                    </div>

                    {/* Floating Tech Elements */}
                    <div className="absolute top-6 left-6 w-12 h-12 bg-blue-500/10 rounded-full animate-float border border-blue-500/20 flex items-center justify-center">
                      <span className="text-blue-400 text-lg">AI</span>
                    </div>
                    <div className="absolute top-10 right-8 w-10 h-10 bg-purple-500/10 rounded-full animate-float border border-purple-500/20 flex items-center justify-center" style={{animationDelay: '1s'}}>
                      <span className="text-purple-400 text-lg">5G</span>
                    </div>
                    <div className="absolute bottom-8 left-16 w-8 h-8 bg-cyan-500/10 rounded-full animate-float border border-cyan-500/20 flex items-center justify-center" style={{animationDelay: '2s'}}>
                      <span className="text-cyan-400 text-sm">IoT</span>
                    </div>
                  </div>
                </div>
              </div>

              {/* Floating Enterprise Badges */}
              <div 
                className="absolute -top-4 -right-4 glass rounded-2xl p-4 animate-float border border-green-500/30"
                style={{ transform: `translate(${mousePosition.x * 0.2}px, ${mousePosition.y * 0.2}px)` }}
              >
                <div className="flex items-center space-x-2">
                  <div className="w-3 h-3 bg-green-400 rounded-full animate-pulse"></div>
                  <span className="text-sm font-semibold text-green-400">Enterprise Ready</span>
                </div>
              </div>

              <div 
                className="absolute -bottom-4 -left-4 bg-gradient-to-r from-blue-500 to-purple-600 rounded-2xl p-4 animate-float glow"
                style={{ 
                  animationDelay: '3s',
                  transform: `translate(${mousePosition.x * 0.15}px, ${mousePosition.y * 0.15}px)` 
                }}
              >
                <div className="text-center">
                  <div className="text-sm font-bold text-white">Custom Solutions</div>
                  <div className="text-xs text-blue-100">Tailored Pricing</div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      {/* Stats Section */}
      <section id="stats-section" className="section-padding relative">
        <div className="absolute inset-0 bg-gradient-to-b from-slate-900 to-slate-800"></div>
        <div className="container-custom relative z-10">
          <div className="grid grid-cols-2 lg:grid-cols-4 gap-8">
            {[
              { number: stats.clients.toLocaleString(), label: 'Enterprise Clients', suffix: '+' },
              { number: stats.vehicles, label: 'Premium Vehicles', suffix: '+' },
              { number: stats.cities, label: 'Cities Covered', suffix: '+' },
              { number: stats.trips.toLocaleString(), label: 'Successful Trips', suffix: '+' }
            ].map((stat, index) => (
              <div key={index} className="text-center glass rounded-3xl p-8 border border-white/10">
                <div className="text-3xl md:text-4xl font-black text-gradient mb-2">
                  {stat.number}{stat.suffix}
                </div>
                <div className="text-gray-300 font-semibold">{stat.label}</div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Enterprise Clients Section */}
      <section className="section-padding relative">
        <div className="container-custom">
          <div className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-black mb-6">
              <span className="text-white">Trusted by</span>{' '}
              <span className="text-gradient">Industry Leaders</span>
            </h2>
            <p className="text-xl text-gray-300 max-w-2xl mx-auto">
              Partnering with global enterprises to deliver exceptional transportation solutions
            </p>
          </div>

          <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-6 gap-8">
            {clients.map((client, index) => (
              <div key={index} className="group text-center glass rounded-2xl p-6 border border-white/5 hover:border-cyan-500/30 transition-all duration-500 transform hover:scale-105">
                <div className="text-3xl mb-3 group-hover:scale-110 transition-transform duration-300">
                  {client.logo}
                </div>
                <div className="font-semibold text-white mb-1">{client.name}</div>
                <div className="text-sm text-cyan-400">{client.type}</div>
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Enterprise Services */}
      <section className="section-padding relative">
        <div className="absolute top-1/4 -left-10 w-72 h-72 bg-blue-500/5 rounded-full blur-3xl"></div>
        <div className="absolute bottom-1/4 -right-10 w-72 h-72 bg-purple-500/5 rounded-full blur-3xl"></div>

        <div className="container-custom relative z-10">
          <div className="text-center mb-16">
            <h2 className="text-4xl md:text-5xl font-black mb-6">
              <span className="text-white">Enterprise</span>{' '}
              <span className="text-gradient">Solutions</span>
            </h2>
            <p className="text-xl text-gray-300 max-w-2xl mx-auto">
              Comprehensive mobility solutions designed for large-scale business operations
            </p>
          </div>

